import MyCard from "../UI/MyCard";
import assets_data from "../data/assets.json";
import { useSelector } from "react-redux";


const CardData = ()=>{
    const getSuccess = useSelector(state=>state.myPage.getSuccess)
    const viziblePage = useSelector(state=>state.myPage.pageList)
    console.log(viziblePage[1])
    const listCharacter = viziblePage[1].map((item)=>
        <MyCard 
            id = {item.id}
            name = {item.name}
            image = {item.image}
            owner = {item.owner}
        />)

    return <div>
    {listCharacter}
    
    </div>

}

export default CardData;
